import React from 'react';
import './App.css';
import {useState} from 'react';

function App() {
  const [lista, setLista] = useState([]);

  const addLista = ()=> {
    let datanow = new Date().getTime();
    setLista([...lista, [datanow,"asd"]]);
    console.log(lista)
  }
  return (
   <div id="container">
     <button onClick={addLista}>Add new</button>
     <div>
        {lista.map(e=>{
          return <div id={e}key={e[0]}>{e[1]}</div>
        })}
     </div>
   </div>
  );
}

export default App;
